  render() {
    const qoute = {
      text: `Life is 10% what happens to me and 90% of how I react to it.`,
      soure: "Charles Swindoll"
    }

    return (
      <Fragment>
        <QouteGenerator 
          text={qoute.text} 
          soure={qoute.source} 
          onClick={() => console.log("abra")}/>
      </Fragment>
    );
  }
}

export default App;
